import React from "react";

export default function Header() {
  function onCreateMatrixBtnClick() {
    count = document.getElementById("vertex_cont").value
    console.log();
  }

  return (
    <div className="right">
      <label>
        Количество вершин графа:
        <input id="vertex_cont" type="number" min="2" max="10" />
      </label>

      <button className="create_matrix_btn" onClick={onCreateMatrixBtnClick}>
        Создать матрицу весов
      </button>
    </div>
  );
}
